import React from 'react';
// import './NavBar.css';

const NavBar = () => {
  return (
    <div className="nav-bar">
      <img className="logo" src="%PUBLIC_URL%/images/logo.jpg" alt="Logo" />
      <a href="#">Xem Phòng</a>
      <a href="#">Khám Phá</a>
      <a href="#">Liên Lạc</a>
      <a href="#" className="book-link">Đặt Phòng</a>
    </div>
  );
};

export default NavBar;
